var app = angular.module("mainApp", ["ngRoute"]);

app.config(function ($routeProvider) {
    $routeProvider
        .when("/other", {
            templateUrl: "veiws/other.html",
            controller: "otherController",
        })
        .otherwise({
            templateUrl: "veiws/main.html",
            controller: "homeController",
        })
});

app.controller("homeController", ["$scope", function ($scope) {
    $scope.computers = [
        {
            name: "Mac Pro",
            img: "https://encrypted-tbn2.gstatic.com/images?q=tbn:ANd9GcQu8iSHF9PSgl4ZpJ0oDy35Nj2uMY5-M-WNWbuwyL0ONIhoZCojhw",
            price: 4000,
        }, {
            name: "BB-8",
            img: "data:image/jpeg;base64,",
            price: 150,
        }, {
            name: "htc Vive",
            img: "data:image/jpeg;base64,",
            price: 800,
        }
                   ];
    $scope.getTotal = function() {
        var total = 0;
        for (var i = 0; i < $scope.computers.length; i++) {
            total += $scope.computers[i].price;
        }
        return total;
    }
}]);
app.controller("otherController", ["$scope", function ($scope) {
    $scope.others = [
        {
            img: "data:image/jpeg;base64,",
            name: "Alfa Romeo 4C",
            price: 60000,
        }, {
            name: "Finish my MGB-GT",
            img: "http://www.britishv8.org/mg/DarrenJones/DarrenJones-AA.jpg",
            price: 10000,
        }, {
            name: "Aston Martin DB24",
            img: "https://encrypted-tbn2.gstatic.com/images?q=tbn:ANd9GcQugmPM2RJAOuDPEyhSLXqrik8gwZCJKczl_eBI0ezvOs4Gt86E",
            price: 400000,
        }
    ];
    $scope.getTotal = function() {
        var total = 0;
        for (var i = 0; i < $scope.others.length; i++) {
            total += $scope.others[i].price;
        }
        return total;
    }
}]);